  const [users, setUsers] = useState<IUser[]>([]);

  return (
    <div>
      <Card
        variant={CardVariant.primary}
        height='200px'
        width='200px'
      >
        <button>Кнопка</button>
      </Card>
      <UserList users={users} />
    </div >
  );
}
